const longestSubstring2 = (str) => {
    const obj = {};
    let start = 0;
    let end = 0;
    let maxLength = 0;
    while(end < str.length) {
        if(!obj[str[end]]) {
            obj[str[end]] = true;
            end++;
            maxLength = Math.max(maxLength, Object.keys(obj).length);
        } else {
            delete obj[str[start]];
            start++;
        }
    }
    return maxLength;
}

